import React from 'react';
import { IRowProps } from '../types/types';
import Column from './Column';

const Row = (props: IRowProps) => {

    const {
        color,
        height
    } = props

    return (
        <>
            <div className="row">
                <Column style={{
                    backgroundColor: color[0],
                    height: height,
                }}
                />
                <Column style={{
                    backgroundColor: color[1],
                    height: height,
                }}
                />
                <Column style={{
                    backgroundColor: color[2],
                    height: height,
                }}
                />
            </div>
        </>
    )
}

export default Row;
